import React from 'react';
import HomePage from './pages/Home/HomePage';
import CustomerPage from './pages/Customer/CustomerPage';
import ProductPage from './pages/Products/ProductPage';
import ProductActionPage from './pages/Action/ProductActionPage';
import NotFoundPage from './pages/NotFound/NotFoundPage';
import UsersPage from './pages/Users/UsersPage';
import UserAddPage from './pages/Users/UserAddPage';
import Login from './pages/Login/Login';
import SmsPage from './pages/Smss/SmsPage';
import SmsActionPage from './pages/Action/SmsActionPage';
const routes = [
	{
		path: '/',
		exact: true,
		main: () => <HomePage/>
	},
	{
		path: '/customers',
		exact: false,
		main: () => <CustomerPage/>
	},


	// Users
	{
		path: '/users',
		exact: true,
		main: ({match, location, history}) => <UsersPage match={match} location={location} history={history}/>
	},
	{
		path: '/users/add',
		exact: false,
		main: ({location, history}) => <UserAddPage history={history} location={location}/>
	},
	{
		path: '/users/:id/edit',
		exact: false,
		main: ({match, location, history}) => <UserAddPage match={match} history={history} location={location}/>
	},
	// Products
	{
		path: '/products',
		exact: false,
		main: ({match, location, history}) => <ProductPage match={match} location={location} history={history}/>
	},
	{
		path: '/products/add',
		exact: false,
		main: ({history}) => <ProductActionPage history={history}/>
	},
	{
		path: '/products/:id/edit',
		exact: false,
		main: ({match, history}) => <ProductActionPage match={match} history={history}/>
	},
	// SMS
	{
		path: '/sms',
		exact: false,
		main: ({match, location, history}) => <SmsPage match={match} location={location} history={history}/>
	},
	{
		path: '/sms/add',
		exact: false,
		main: ({history}) => <SmsActionPage history={history}/>
	},
	{
		path: '/sms/:id/edit',
		exact: false,
		main: ({match, history}) => <SmsActionPage match={match} history={history}/>
	},
	// Login
	{
		path: '/login',
		exact: false,
		main: ({match}) => <Login match={match}/>
	},
	// Not Found Page
	{
		path: '',
		exact: false,
		main: ({match}) => <NotFoundPage  match={match}/>
	}
];

export default routes;
